  const navigation = useNavigation()

  return (
    <View style={styles.pruebasEncontradasDetalle}>
      <View style={[styles.unsplashon4qwhhjcemParent, styles.parentPosition]}>
        <Image
          style={styles.unsplashon4qwhhjcemIcon}
