          source={require('../assets/unsplashon4qwhhjcem.png')}
        />
        <View style={styles.frameParent}>
          <View style={styles.frameGroup}>
            <View>
              <Text style={[styles.pruebaDeCiclismo, styles.reseasDeLaTypo]}>
                Prueba de ciclismo
